import { Modal } from '@mui/material'
import React from 'react'

function Login() {
    return (<Modal open = {open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"></Modal>)
}
export default Login;
